Howdy.. from Austin Texas!!  May the Lord of All Boxes shower favor upon me
and bring me clearer reception!  There.. that should do it :-)

Seriously - Austin isn&#39;t as large as say Chicago but it&#39;s a secondary size
city.. so that can&#39;t be it.  The funny thing is I hear my files fine.. and I
am always surprised when others don&#39;t..  but maybe they are just for me?  I
have heard that can be the case.  I really do wish mine were clearer -  I
wish they weren&#39;t so staticy (is that a word?)  I use the 470 mainly because
it was my first and you know what they say about first loves and all.. but
maybe I will force my spirit friends to try and deal with my 469.  They
don&#39;t like it and have told me so..   but I believe they are just being lazy
(and if you can read my computer screen spirit buddies and pals - that is a
joke) I will make them use it and see how it goes.

k





  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Rhonda W
Sent: Thursday, March 27, 2008 3:02 PM
To: EVP-ITC@yahoogroups.com
Subject: Re: [EVP-ITC] Re: New file uploaded to EVP-ITC



I believe Kristin is using the 470 like me.  She doesnt get very good
reception where she is...think she said she lived in a small town.



Rhonda

psfponies &lt;psfponies@...&gt; wrote:

That was awesome Mike.... 

You are using the 12-469? I have trouble hearing Kristins files for 
some reason not sure which unit she is using but that was very clear.

Kay

--- In EVP-ITC@yahoogroups &lt;mailto:EVP-ITC%40yahoogroups.com&gt; .com,
EVP-ITC@yahoogroups &lt;mailto:EVP-ITC%40yahoogroups.com&gt; .com wrote:
&gt;
&gt; 
&gt; Hello,
&gt; 
&gt; This email message is a notification to let you know that
